import { Box } from '@mui/material';
import React from 'react';
import './Home.scss';

const Home = () => {
  return (
    <main id="home">
      <section className="hero">
          <h1 className="hero-slogan">
            #1 GROUP WATCH PLATFORM
          </h1>
      </section>
    </main>
  )
}

export default Home;
